import React from 'react'
import { Link, NavLink } from 'react-router-dom'

const NavBar = () => {
  return (
    <div>
      <NavLink to="/">Home</NavLink>

      <NavLink to="/Movies">Movies</NavLink>

      <NavLink to="/Customers">Customers</NavLink>
    </div>
  )
}

export default NavBar
